import React from 'react';
import Footer from '../components/Footer';
import Pagevists from '../components/Cards/Pagevists';
import Statistics from '../components/Cards/Statistics';
import Sales from '../components/Cards/Sales';
import Team from '../components/Cards/Team';
import Orders from '../components/Cards/Orders';
import Todos from '../components/Cards/Todos';
import Feeds from '../components/Cards/Feeds';
import DefaultsNav from '../components/DefaultsNav';


const Dashboard = () => {
  
  return (

<div class="main-content" id="panel">
    <div class="header bg-primary pb-6">
      <div class="container-fluid">
        <div class="header-body">
          <div class="row align-items-center py-4">
            <div class="col-lg-6 col-7">
              <h6 class="h2 text-white d-inline-block mb-0">Default</h6>
           <DefaultsNav/>
            </div>
            <div class="col-lg-6 col-5 text-right">
              <a href="#" class="btn btn-sm btn-neutral">New</a>
              <a href="#" class="btn btn-sm btn-neutral">Filters</a>
            </div>
          </div>
         
          <div class="row">
         <Statistics/>
         </div>
        </div>
      </div>
    </div>
    
    <div class="container-fluid mt--6">
      <div class="row">
        <Sales/>
      </div>
      <div class="row">
       <Team/>
        <Todos/>
        <Orders/>
        
      </div>
      <div class="row">
        <Feeds/>
      </div>
      <div class="row">
        <Pagevists/>
      </div>

     
     <Footer/>
    </div>
  </div>
);
};

export default Dashboard;
